import React, { useEffect, useState } from "react"
import { useNavigate } from "react-router-dom"
import axios from "axios"
import { Card, CardContent, CardDescription, CardHeader, CardTitle } from "../components/ui/card"
import {
  Sidebar,
  SidebarContent,
  SidebarFooter,
  SidebarHeader,
  SidebarMenu,
  SidebarMenuButton,
  SidebarMenuItem,
  SidebarProvider,
} from "../components/ui/sidebar"

const Icon = ({ name, className }) => {
  // ... icons unchanged
}

export default function AdminDashboard() {
  const navigate = useNavigate()
  const [activeTab, setActiveTab] = useState("dashboard")
  const [analytics, setAnalytics] = useState({
    users: 0,
    orders: { Pending: 0, Completed: 0, Cancelled: 0 },
    revenue: 0,
    products: 0,
  })

  useEffect(() => {
    const fetchAnalytics = async () => {
      try {
        const [userCount, orderCounts, totalRevenue, availableProducts] = await Promise.all([
          axios.get("http://localhost:8080/admin/analytics/user-count"),
          axios.get("http://localhost:8080/admin/analytics/order-status-counts"),
          axios.get("http://localhost:8080/admin/analytics/total-revenue"),
          axios.get("http://localhost:8080/admin/analytics/available-products-count"),
        ])

        setAnalytics({
          users: userCount.data,
          orders: orderCounts.data,
          revenue: totalRevenue.data,
          products: availableProducts.data,
        })
      } catch (err) {
        console.error("Error fetching analytics:", err)
      }
    }

    fetchAnalytics()
  }, [])

  return (
    <SidebarProvider>
      <div className="flex min-h-screen bg-gray-50">
        {/* Sidebar remains unchanged */}
        <div className="flex-1 overflow-auto">
          <header className="sticky top-0 z-10 flex h-14 items-center gap-4 border-b bg-white px-6">
            <h1 className="text-xl font-semibold">Admin Dashboard</h1>
            <div className="ml-auto flex items-center gap-2">
              <div className="flex items-center gap-2">
                <div className="h-8 w-8 rounded-full bg-purple-100 flex items-center justify-center">
                  <span className="text-sm font-medium text-purple-700">AD</span>
                </div>
                <span className="text-sm font-medium">Admin</span>
              </div>
            </div>
          </header>
          <main className="p-6">
            <div className="grid gap-6">
              <section>
                <h2 className="text-2xl font-bold tracking-tight mb-6">Overview</h2>
                <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-4">
                  <StatCard
                    title="Total Users"
                    value={analytics.users.toLocaleString()}
                    description="Total number of registered users"
                    icon={<Icon name="users" className="h-5 w-5 text-gray-500" />}
                  />
                  <StatCard
                    title="Pending Orders"
                    value={analytics.orders.Pending.toLocaleString()}
                    description="Currently awaiting processing"
                    icon={<Icon name="orders" className="h-5 w-5 text-gray-500" />}
                  />
                  <StatCard
                    title="Total Revenue"
                    value={`$${Number(analytics.revenue).toLocaleString(undefined, { minimumFractionDigits: 2 })}`}
                    description="From completed orders"
                    icon={<Icon name="analytics" className="h-5 w-5 text-gray-500" />}
                  />
                  <StatCard
                    title="Available Products"
                    value={analytics.products.toLocaleString()}
                    description="Currently in stock"
                    icon={<Icon name="products" className="h-5 w-5 text-gray-500" />}
                  />
                </div>
              </section>

              {/* Recent Activity and SalesChart remain unchanged */}
            </div>
          </main>
        </div>
      </div>
    </SidebarProvider>
  )
}

function StatCard({ title, value, description, icon }) {
  return (
    <Card>
      <CardHeader className="flex flex-row items-center justify-between pb-2">
        <CardTitle className="text-sm font-medium">{title}</CardTitle>
        {icon}
      </CardHeader>
      <CardContent>
        <div className="text-2xl font-bold">{value}</div>
        <p className="text-xs text-gray-500">{description}</p>
      </CardContent>
    </Card>
  )
}
